// src/pages/Dashboard.js
import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link, useLocation, useNavigate } from "react-router-dom";
import { motion } from "framer-motion";
import "../styles/Dashboard.css";

const API_URL = "http://localhost:1212/api";

const Dashboard = ({ token, userId, onLogout }) => {
  const [flights, setFlights] = useState([]);
  const [wallet, setWallet] = useState(null);
  const location = useLocation();
  const navigate = useNavigate();

  const fetchFlights = async () => {
    try {
      const res = await axios.get(`${API_URL}/flights`, {
        headers: { Authorization: `Bearer ${token}` },
      });

      const allFlights = res.data;
      const { search } = location.state || {};

      // Optional filter by search criteria
      if (search && search.source && search.destination && search.date) {
        const filtered = allFlights.filter(
          (f) =>
            f.source.toLowerCase().includes(search.source.toLowerCase()) &&
            f.destination.toLowerCase().includes(search.destination.toLowerCase()) &&
            f.departureDate === search.date
        );
        setFlights(filtered);
      } else {
        setFlights(allFlights);
      }
    } catch (err) {
      console.error("Failed to fetch flights", err);
    }
  };

  const fetchWallet = async () => {
    if (!userId) return;
    try {
      const res = await axios.get(`${API_URL}/wallets/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setWallet(res.data);
    } catch (err) {
      console.error("Failed to fetch wallet", err);
    }
  };

  const topUpWallet = async (amount) => {
    try {
      await axios.post(
        `${API_URL}/wallets/topup`,
        { userId, amount },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      fetchWallet();
      alert("Wallet topped up successfully!");
    } catch (err) {
      alert("Top-up failed");
    }
  };

  const goToBookingPage = (flight) => {
    navigate("/booking", { state: { flight, userId, token } });
  };

  useEffect(() => {
    fetchFlights();
    fetchWallet();
  }, []);

  return (
    <motion.div className="dashboard-container" initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
      <aside className="sidebar">
        <h2>Dashboard</h2>
        <nav>
          <ul>
            <li><Link to="/flights">✈️ View Flights</Link></li>
            <li><Link to="/wallet">💰 Wallet</Link></li>
            <li><Link to="/bookings">📄 Booking History</Link></li>
            <li><button className="logout-btn" onClick={onLogout}>🚪 Logout</button></li>
          </ul>
        </nav>
      </aside>

      <main className="dashboard-main">
        <h1>Welcome to Your Flight Dashboard</h1>
        <h2>✈️ Available Flights</h2>
        <ul className="flight-list">
          {flights.map((flight, idx) => (
            <li key={flight.flightId}>
              {flight.flightNumber} — {flight.source} → {flight.destination} on {flight.departureDate}
              <button onClick={() => goToBookingPage(flight)}>Book</button>
            </li>
          ))}
        </ul>

        <h2>💰 Wallet</h2>
        {wallet ? (
          <p className="wallet-balance">Balance: ₹{wallet.balance.toLocaleString()}</p>
        ) : (
          <button onClick={fetchWallet}>Load Wallet</button>
        )}
        <div>
          <button onClick={() => topUpWallet(1000)}>Top Up ₹1000</button>
        </div>
      </main>
    </motion.div>
  );
};

export default Dashboard;
